import CartItem from "./cartitem";
const Cart=(props)=>{
    
   return (<div className="d-flex flex-wrap mt-2 ms-5 mr-5" style={{}} >
   {props.books?props.books.map((e)=>{
        return <CartItem key={e.refno} name={e.name} author={e.author} publishedDate={e.publishedDate} no_of_copies={e.no_of_copies} />
    }):<></>}
   </div>)

}
export default Cart;
